export class Item {
  constructor(id, rank, rankUpDown, title, fullTitle, year, image, crew, imDbRating, imDbRatingCount, genre) {
    this.id = id;
    this.rank = rank;
    this.rankUpDown = rankUpDown;
    this.title = title;
    this.fullTitle = fullTitle;
    this.year = year;
    this.image = image;
    this.crew = crew;
    this.imDbRating = imDbRating;
    this.imDbRatingCount = imDbRatingCount;
    this.genre = genre;
  }

}
